import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

export default function Chats() {
  return (
    <View>
        <View style={styles.container}>
           <Text style={{fontSize:20}}>Messages</Text>
        </View> 
     
    </View>
  )
}

const styles = StyleSheet.create({
    container:{
        marginTop:40,
        marginLeft:15,
    }
})
